import React, { PureComponent } from 'react';
import '../assets/css/Dashboard.css';
import {
  PieChart,
  Pie,
  XAxis,
  YAxis,
  Tooltip,
  Legend,
  ResponsiveContainer,
  Label,
} from 'recharts';


class PieGraphCard extends PureComponent {

  render() {

    const { graphData } = this.props;

    return (

      <div className="card-big-container">
        <div className="card-title"> Follower Region Distribution </div>
        <ResponsiveContainer width={290} height="70%" className="chart-container">
          <PieChart >
            <Pie isAnimationActive={false} data={graphData} cy={80} cy={90} fill="#D9CCDF" label/>
            <Tooltip/>
         </PieChart>
       </ResponsiveContainer>
      </div>
    )

  }

}



export default PieGraphCard;
